import React from 'react';
import {ListGroup,ListGroupItem} from 'reactstrap';
const UsersList = ({users}) => {
    return (
        <ListGroup>
            {users.map((user) =>{
                return <ListGroupItem key ={user.id}>{user.name}</ListGroupItem>
            })}
        </ListGroup>
    )
};
export default UsersList;
